Note: Setting up Scream with IVSHMEM is not the preferred way of doing it, and probably will have more disadvantages than advantages. Host Setup Add the following to your NixOS configuration and rebuild it: # Pipewire + pulseaudio support (you can also use just pulseaudio) services.pipewire = { enable = true; pulse.enable = true; }; # Scream
systemd.tmpfiles.rules = [ "f /dev/shm/scream 0660 your-username-here qemu-libvirtd -"
]; systemd.user.services.scream-ivshmem = { enable = true; description = "Scream IVSHMEM"; serviceConfig = { ExecStart = "${pkgs.scream}/bin/scream -o pulse -m /dev/shm/scream"; Restart = "always"; }; wantedBy = [ "default.target" ]; requires = [ "pipewire.service" ]; # Change to pulseaudio.service if using it
}; Add Scream's SHMEM configuration inside the <devices> section in the XML config: <shmem name="scream"> <model type="ivshmem-plain"/> <size unit="M">2</size> <address type="pci" domain="0x0000" bus="0x00" slot="0x11" function="0x0"/>
</shmem> Guest Setup Add IVSHMEM support Download and Install Scream Drivers . To make the driver use IVSHMEM , run from an elevated shell: REG ADD HKLM\SYSTEM\CurrentControlSet\Services\Scream\Options /v UseIVSHMEM /t REG_DWORD /d 2. You should now be able to hear the guest's audio on your host.

